(1, 'papercut', '460', '1', '', '', 'olegnax/athlete/revolution/features_02.jpg', '<div class="caption sfr athlete_caption_light"  data-x="380" data-y="90" data-speed="500" data-start="500" data-easing="easeOutBack">ELEGANT & FLEXIBLE</div>\r\n\r\n<div class="caption sfl athlete_caption_light"  data-x="486" data-y="150" data-speed="500" data-start="500" data-easing="easeOutBack">SLIDESHOWS</div>\r\n\r\n<div class="caption fade athlete_medium_text_light" style="color:#706f71;" data-x="450" data-y="286" data-speed="500" data-start="1100" data-easing="easeOutExpo">This theme comes with two flexible slideshows!</div>\r\n\r\n<div class="caption fade athlete_medium_text_light" style="color:#706f71;" data-x="459" data-y="316" data-speed="500" data-start="1100" data-easing="easeOutExpo">that gives you full control over your slideshow</div>\r\n\r\n<div class="caption fade athlete_medium_text_light" style="color:#706f71;" data-x="562" data-y="346" data-speed="500" data-start="1100" data-easing="easeOutExpo">content and animation.</div>\\r\\n\\r\\n<div class="caption sfb athlete_white_bg_bold"  data-x="434" data-y="230" data-speed="500" data-start="800" data-easing="easeOutExpo">FLEXSLIDER & REVOLUTION</div>\r\n\r\n<div class="caption randomrotate athlete_large_caption_light"  data-easing="easeOutBack">light</div>\r\n<div class="caption randomrotate athlete_white_bg_medium"  data-easing="easeOutBack">bold</div>', 1, 2, '2014-03-16 16:55:25', '2014-03-16 16:55:25'),
