(2745, 30, 3, 'M9179LL|qBrand|None|30" Flat-Panel TFT-LCD Cinema HD Monitor|30"|* Digital (DVI), USB 2.0 and FireWire 400 inputs * Cinema HD delivers up to 16.7 million colors across a wide gamut for a breathtaking, vivid picture * ColorSync technology lets you create a custom profile to maintain consistent colors on the screen and in print * Single cable with breakout for DVI, USB and FireWire ports provides a tidy look while reducing clutter * Built-in, 2-port USB 2.0 hub to easily connect peripheral devices * User controls allow you to monitor display power, system sleep/wake, brightness and monitor tilt * Antiglare, hard-coat screen treatment * Wall-mountable with optional mounting kit (not included) * ENERGY STAR compliance assures a high standard of energy efficiency|Computer games, digital photo editing and graphic applications will astound you on this huge 30" flat-panel monitor. Cinema HD and ColorSync technology let you enjoy 16.7 million breathtaking colors and custom profiling for color consistency.|699.99|1'),
