(2811, 32, 4, '1gbdimm|uBrand|None|Crucial 1GB PC4200 DDR2 533MHz Memory|Crucial 1024MB PC4200 DDR2 533MHz Memory Crucial Technologies is part of Micron, the largest DRAM manufacturer in the U.S. and one of the largest in the world. Because they actually manufacture memory, they have unparalleled expertise in the upgrade industry. Crucial is the only consumer memory upgrade supplier that is part of a major DRAM manufacturer. Every single Crucial memory module is tested before it goes out their doors. Crucial chips are individually tested under varying temperatures, voltages, and operational conditions for performance and functionality.|Crucial 1024MB PC4200 DDR2 533MHz Memory Crucial Technologies is part of Micron, the largest DRAM manufacturer in the U.S. and one of the largest in the world. Because they actually manufacture memory, they have unparalleled expertise in the upgrade industry. Crucial is the only consumer memory upgrade supplier that is part of a major DRAM manufacturer. Every single Crucial memory module is tested before it goes out their doors. Crucial chips are individually tested under varying temperatures, voltages, and operational conditions for performance and functionality.|150.99|1'),
(2809, 30, 4, 'M9179LL|qBrand|None|30" Flat-Panel TFT-LCD Cinema HD Monitor|30"|* Digital (DVI), USB 2.0 and FireWire 400 inputs * Cinema HD delivers up to 16.7 million colors across a wide gamut for a breathtaking, vivid picture * ColorSync technology lets you create a custom profile to maintain consistent colors on the screen and in print * Single cable with breakout for DVI, USB and FireWire ports provides a tidy look while reducing clutter * Built-in, 2-port USB 2.0 hub to easily connect peripheral devices * User controls allow you to monitor display power, system sleep/wake, brightness and monitor tilt * Antiglare, hard-coat screen treatment * Wall-mountable with optional mounting kit (not included) * ENERGY STAR compliance assures a high standard of energy efficiency|Computer games, digital photo editing and graphic applications will astound you on this huge 30" flat-panel monitor. Cinema HD and ColorSync technology let you enjoy 16.7 million breathtaking colors and custom profiling for color consistency.|699.99|1'),
(2810, 31, 4, '2gbdimm|uBrand|None|Crucial 2GB PC4200 DDR2 533MHz Memory|Crucial 2GB PC4200 DDR2 533MHz Memory Crucial Technologies is part of Micron, the largest DRAM manufacturer in the U.S. and one of the largest in the world. Because they actually manufacture memory, they have unparalleled expertise in the upgrade industry. Crucial is the only consumer memory upgrade supplier that is part of a major DRAM manufacturer. Every single Crucial memory module is tested before it goes out their doors. Crucial chips are individually tested under varying temperatures, voltages, and operational conditions for performance and functionality.|Crucial 2GB PC4200 DDR2 533MHz Memory Crucial Technologies is part of Micron, the largest DRAM manufacturer in the U.S. and one of the largest in the world. Because they actually manufacture memory, they have unparalleled expertise in the upgrade industry. Crucial is the only consumer memory upgrade supplier that is part of a major DRAM manufacturer. Every single Crucial memory module is tested before it goes out their doors. Crucial chips are individually tested under varying temperatures, voltages, and operational conditions for performance and functionality.|199.99|1'),
(2808, 29, 4, 'W1952TQ-TF|eBrand|None|19" Widescreen Flat-Panel LCD Monitor|19"|Experience smooth gaming visuals and crystal-clear video with this 19" flat-panel LCD monitor that features an ultrafast 2 ms response time and sharp 10,000:1 contrast. The DVI-D with HDCP input lets you connect a DVD player or other digital video device. Product Features * Ultrafast 2 ms response time * Digital Fine 10,000:1 contrast ratio; 300 cd/m² brightness * 1440 x 900 maximum resolution; wide 170° horizontal and vertical viewing angles|2 ms response time; 10,000:1 contrast ratio; 300 cd/m² brightness; 1440 x 900 maximum resolution; DVI-D and 15-pin D-sub inputs|399.99|1'),
(2807, 28, 4, 'W2452T-TF|jBrand|None|24" Widescreen Flat-Panel LCD Monitor|24"|With ultrafine 10,000:1 contrast and wide 170° viewing angles, this 24" widescreen LCD monitor delivers crystal-clear high-definition visuals for gaming and work projects. The DVI-D input lets you connect a DVD player or other digital video device. Product Features: * Ultrafast 5 ms response time * Digital Fine 10,000:1 contrast ratio; 400 cd/m² brightness * 1920 x 1200 maximum resolution; wide 170° horizontal and vertical viewing angles|5 ms response time; 10,000:1 contrast ratio; 400 cd/m² brightness; 1920 x 1200 maximum resolution; DVI-D and 15-pin D-sub inputs|699.99|1'),
(2806, 27, 4, '226bw|xBrand|None|22" Syncmaster LCD Monitor|22"|The wide, 16:10 format of SAMSUNG''s 226BW digital/Analog widescreen LCD monitor gives you plenty of room for all your computer applications and multiple images. DC 3000:1 contrast ratio creates crisp, easy-to-view images and gaming graphics, without ghosting or blurring. Complete with Microsoft® Vista® Premium certification and advanced dual interface for both analog digital video signals, the 226BW monitor is future-ready.|The wide, 16:10 format of SAMSUNG''s 226BW digital/Analog widescreen LCD monitor gives you plenty of room for all your computer applications and multiple images. DC 3000:1 contrast ratio creates crisp, easy-to-view images and gaming graphics, without ghosting or blurring. Complete with Microsoft® Vista® Premium certification and advanced dual interface for both analog digital video signals, the 226BW monitor is future-ready.|399.99|1'),
