(527, 4, 72, 0, 27, 'The wide, 16:10 format of SAMSUNG''s 226BW digital/Analog widescreen LCD monitor gives you plenty of room for all your computer applications and multiple images. DC 3000:1 contrast ratio creates crisp, easy-to-view images and gaming graphics, without ghosting or blurring. Complete with Microsoft® Vista® Premium certification and advanced dual interface for both analog digital video signals, the 226BW monitor is future-ready.'),
(528, 4, 73, 0, 27, 'The wide, 16:10 format of SAMSUNG''s 226BW digital/Analog widescreen LCD monitor gives you plenty of room for all your computer applications and multiple images. DC 3000:1 contrast ratio creates crisp, easy-to-view images and gaming graphics, without ghosting or blurring. Complete with Microsoft® Vista® Premium certification and advanced dual interface for both analog digital video signals, the 226BW monitor is future-ready.'),
(529, 4, 83, 0, 27, NULL),
(530, 4, 106, 0, 27, NULL),
(531, 4, 72, 0, 28, 'With ultrafine 10,000:1 contrast and wide 170° viewing angles, this 24" widescreen LCD monitor delivers crystal-clear high-definition visuals for gaming and work projects. The DVI-D input lets you connect a DVD player or other digital video device.\r\n\r\nProduct Features:\r\n    * Ultrafast 5 ms response time\r\n    * Digital Fine 10,000:1 contrast ratio; 400 cd/m² brightness\r\n    * 1920 x 1200 maximum resolution; wide 170° horizontal and vertical viewing angles\r\n'),
(532, 4, 73, 0, 28, '5 ms response time; 10,000:1 contrast ratio; 400 cd/m² brightness; 1920 x 1200 maximum resolution; DVI-D and 15-pin D-sub inputs'),
(533, 4, 83, 0, 28, NULL),
(534, 4, 106, 0, 28, NULL),
(535, 4, 72, 0, 29, 'Experience smooth gaming visuals and crystal-clear video with this 19" flat-panel LCD monitor that features an ultrafast 2 ms response time and sharp 10,000:1 contrast. The DVI-D with HDCP input lets you connect a DVD player or other digital video device.\r\nProduct Features\r\n\r\n    * Ultrafast 2 ms response time\r\n    * Digital Fine 10,000:1 contrast ratio; 300 cd/m² brightness\r\n    * 1440 x 900 maximum resolution; wide 170° horizontal and vertical viewing angles\r\n'),
(536, 4, 73, 0, 29, '2 ms response time; 10,000:1 contrast ratio; 300 cd/m² brightness; 1440 x 900 maximum resolution; DVI-D and 15-pin D-sub inputs'),
(537, 4, 83, 0, 29, NULL),
(538, 4, 106, 0, 29, NULL),
(539, 4, 72, 0, 30, '    * Digital (DVI), USB 2.0 and FireWire 400 inputs\r\n    * Cinema HD delivers up to 16.7 million colors across a wide gamut for a breathtaking, vivid picture\r\n    * ColorSync technology lets you create a custom profile to maintain consistent colors on the screen and in print\r\n    * Single cable with breakout for DVI, USB and FireWire ports provides a tidy look while reducing clutter\r\n    * Built-in, 2-port USB 2.0 hub to easily connect peripheral devices\r\n    * User controls allow you to monitor display power, system sleep/wake, brightness and monitor tilt\r\n    * Antiglare, hard-coat screen treatment\r\n    * Wall-mountable with optional mounting kit (not included)\r\n    * ENERGY STAR compliance assures a high standard of energy efficiency\r\n'),
(540, 4, 73, 0, 30, 'Computer games, digital photo editing and graphic applications will astound you on this huge 30" flat-panel monitor. Cinema HD and ColorSync technology let you enjoy 16.7 million breathtaking colors and custom profiling for color consistency.'),
(541, 4, 83, 0, 30, NULL),
(542, 4, 106, 0, 30, NULL),
(543, 4, 72, 0, 31, 'Crucial 2GB PC4200 DDR2 533MHz Memory\r\nCrucial Technologies is part of Micron, the largest DRAM manufacturer in the U.S. and one of the largest in the world. Because they actually manufacture memory, they have unparalleled expertise in the upgrade industry. Crucial is the only consumer memory upgrade supplier that is part of a major DRAM manufacturer.\r\n\r\nEvery single Crucial memory module is tested before it goes out their doors. Crucial chips are individually tested under varying temperatures, voltages, and operational conditions for performance and functionality. '),
