(1, '404 Not Found 1', 'one_column', 'Page keywords', 'Page description', 'no-route', NULL, '<h1><img src="{{media url="wysiwyg/oops.jpg"}}" alt="" />&nbsp;&nbsp;&nbsp; 404 - page not found</h1>\r\n<br/>\r\n<p>The page you requested was not found, and we have a fine guess why</p>\r\n<ul><li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li></ul>\r\n<p><button class="button" onclick="window.location=''{{store url=''''}}''"><span><span>back to main</span></span></button></p>\r\n<br/><hr/><br/>\r\n<h2>Maybe you''ll find what you are looking in following categories</h2><br/>\r\n<a href="http://athlete.olegnax.com/index.php/sports.html"  class="no-padding"><img src="{{media url="wysiwyg/winter_small_banner.jpg"}}" alt="" /></a><a href="http://athlete.olegnax.com/index.php/men/shoes.html" class="no-padding"><img src="{{media url="wysiwyg/shoes_small_banner.jpg"}}" alt="" /></a><a href="http://athlete.olegnax.com/index.php/men/gear/golf-equipment.html" class="no-padding"><img src="{{media url="wysiwyg/golf_small_banner.jpg"}}" alt="" /></a><a href="http://athlete.olegnax.com/index.php/sports.html"  class="no-padding"><img src="{{media url="wysiwyg/winter_small_banner.jpg"}}" alt="" /></a>\r\n<br/><br/>\r\n\r\n', '2013-11-18 10:48:48', '2014-02-25 17:28:22', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Home page', 'two_columns_right', NULL, NULL, 'home', NULL, '<div class="page-title"><h2>Home Page</h2></div>\r\n', '2013-11-18 10:48:48', '2013-11-18 10:48:53', 1, 0, '<!--<reference name="content">\n        <block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page">\n            <action method="addPriceBlockType">\n                <type>bundle</type>\n                <block>bundle/catalog_product_price</block>\n                <template>bundle/catalog/product/price.phtml</template>\n            </action>\n        </block>\n        <block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new">\n            <action method="addPriceBlockType">\n                <type>bundle</type>\n                <block>bundle/catalog_product_price</block>\n                <template>bundle/catalog/product/price.phtml</template>\n            </action>\n        </block>\n        <block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed">\n            <action method="addPriceBlockType">\n                <type>bundle</type>\n                <block>bundle/catalog_product_price</block>\n                <template>bundle/catalog/product/price.phtml</template>\n            </action>\n        </block>\n    </reference>\n    <reference name="right">\n        <action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\n        <action method="unsetChild"><alias>right.reports.product.compared</alias></action>\n    </reference>-->', NULL, NULL, NULL, NULL, NULL),
